import React from "react";
import logo from "./logo.svg";

function Navbar() {
  return (
    <header className="App-header">
      <nav>
        <img src={logo} className="App-logo" alt="logo" />
        <h3>CorgiOS</h3>
        <ul>
          <li>Pricing</li>
          <li>Contact</li>
          <li>Who are we?</li>
        </ul>
      </nav>
    </header>
  );
}

export default Navbar;
